import React from 'react'
import { usePokemons } from '../../context/Pokemons/PokemonsContext'

export default () => {
  const {
    data,
    actions: { getPaginated }
  } = usePokemons()

  return (
    <div>{data.paginated.paginatedData?.results.map((item) => item.name)}</div>
  )
}
